// src/features/wallet/DepositModal.jsx
import React, { useEffect, useState } from 'react';
import { createDepositIntent, confirmDepositDev, fetchWallet } from './walletApi';
import './wallet.css';

export default function DepositModal({ onClose, onDeposited }) {
  const [amount, setAmount] = useState('25.00');
  const [step, setStep] = useState('form'); // 'form' | 'processing' | 'review'
  const [intent, setIntent] = useState(null); // { intentId, clientSecret, amountCents }
  const [loading, setLoading] = useState(false);
  const [err, setErr] = useState('');

  const dollarsToCents = (v) => Math.round(Number(v) * 100);

  const startDeposit = async (e) => {
    e?.preventDefault?.();
    setErr('');
    const cents = dollarsToCents(amount || 0);
    if (!Number.isFinite(cents) || cents <= 0) {
      setErr('Enter a valid amount.');
      return;
    }
    try {
      setLoading(true);
      const i = await createDepositIntent(cents);
      setIntent(i);
      // In real Stripe UI you’d confirm the payment here with card elements.
      setStep('review');
    } catch (e2) {
      setErr(e2.message || 'Failed to start deposit');
    } finally {
      setLoading(false);
    }
  };

  const finishDevConfirm = async () => {
    if (!intent?.intentId) return;
    try {
      setLoading(true);
      await confirmDepositDev(intent.intentId);
      // refresh wallet in parent
      onDeposited?.();
      onClose?.();
      alert('✅ Deposit confirmed (dev mode). Balance updated.');
    } catch (e2) {
      setErr(e2.message || 'Failed to confirm deposit');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="pfb-backdrop" onClick={onClose}>
      <div className="pfb-modal" onClick={(e) => e.stopPropagation()} role="dialog" aria-modal="true">
        <div className="pfb-header">
          <h3>Deposit to PeerFund Balance</h3>
          <button className="pfb-close" onClick={onClose} aria-label="Close">✕</button>
        </div>

        {err && <div className="pfb-error">{err}</div>}

        {step === 'form' && (
          <form onSubmit={startDeposit} className="pfb-body">
            <label className="pfb-field">
              <span>Amount</span>
              <div className="pfb-amount">
                <span>$</span>
                <input
                  type="number"
                  min="1"
                  step="0.01"
                  value={amount}
                  onChange={(e) => setAmount(e.target.value)}
                />
              </div>
            </label>

            {/* Later: Stripe CardElement goes here */}

            <div className="pfb-actions">
              <button type="button" className="btn" onClick={onClose}>Cancel</button>
              <button type="submit" className="btn btn--primary" disabled={loading}>
                {loading ? 'Starting…' : 'Continue'}
              </button>
            </div>
          </form>
        )}

        {step === 'review' && (
          <div className="pfb-body">
            <p><strong>Amount:</strong> ${(intent.amountCents / 100).toFixed(2)}</p>
            <p className="pfb-note">
              Dev shortcut: click <em>Confirm Deposit</em> to simulate a successful payment and update your wallet balance.
            </p>
            <div className="pfb-actions">
              <button className="btn" onClick={() => setStep('form')}>Back</button>
              <button className="btn btn--primary" onClick={finishDevConfirm} disabled={loading}>
                {loading ? 'Confirming…' : 'Confirm Deposit'}
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
